  // console.log('state', projectState);

  const [animateJSON, setAnimateJSON] = useState({});

  studio.initialize();

  useEffect(() => {
    const storedData = localStorage.getItem('theatre-0.4.persistent');
    if (storedData) {
      const parsedData = JSON.parse(storedData);
      setAnimateJSON(parsedData);
    }
  }, []);

  const project = getProject('Test Project', {});
  const sheet = project.sheet('Scene', 'default');

  console.log('animateJSON', animateJSON);

  return (
    <BrowserRouter>
      <Routes>
        <Route
          path='/'
          element={
            <Playground
              project={project}
              sheet={sheet}
              setAnimateJSON={setAnimateJSON}
              animateJSON={animateJSON}
            />
          }
        />
        <Route
          path='demo-scroll'
          element={<DemoScroll project={project} sheet={sheet} />}
        />
        <Route
          path='demo-video'
          element={<DemoVideo project={project} sheet={sheet} />}
        />
      </Routes>
    </BrowserRouter>
  );
}
